import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import AddResource from "./AddResource";
function FrontEnd() {
  const [open, setOpen] = useState(false);

  const handleClickToOpen = () => {
    setOpen(true);
  };

  const handleToClose = () => {
    setOpen(false);
  };

  return (
    <div className="row">
      <div
        className="col-xl-6 mb-4"
        style={{ width: "95%", marginLeft: "auto", marginRight: "auto" }}
      >
        <div className="card">
          <div className="card-body">
            <div className="d-flex justify-content-between align-items-center">
              <div className="d-flex align-items-center">
                <button
                  type="button"
                  class="btn btn-secondary "
                  style={{ height: "45px", width: "45px" }}
                >
                  WEEK
                  <br /> (1 - 2)
                </button>
                <div className="ms-3">
                  <h2 className="fw-bold mb-1">React fundamentals and Hooks</h2>
                </div>
              </div>
            </div>
            <span className="badge rounded-pill badge-success">Active</span>
          </div>
        </div>
        <div className="card-footer border-0 bg-light p-2 d-flex justify-content-around">
          <button
            type="button"
            class="btn btn-outline-primary btn-sm"
            style={{ marginRight: "40px" }}
            onClick={handleClickToOpen}
          >
            Add Resource
          </button>
          <AddResource isOpen={open} onClose={handleToClose} />
          <button type="button" class="btn btn-outline-primary btn-sm ">
            <NavLink
              to="/viewresource"
              role="button"
              style={{ textDecoration: "none" }}
            >
              View Resources
            </NavLink>
          </button>
        </div>
      </div>
    </div>
  );
}

export default FrontEnd;
